	func parseBezierPath(from string: String) -> UIBezierPath {
		let bezierPath = UIBezierPath()
		
		var cmds = string.components(separatedBy: "\n")
		for cmd in cmds {
			let f: [CGFloat] = extractFloats(from: cmd)
			if f.count == 2 {
				bezierPath.move(to: .init(x: f[0], y: f[1]))
			} else if f.count == 4 {
				bezierPath.addQuadCurve(to: .init(x: f[2], y: f[3]), controlPoint: .init(x: f[0], y: f[1]))
			}
		}
		
		return bezierPath
	}
	
	func extractFloats(from string: String) -> [CGFloat] {
		let trimmedString = string.trimmingCharacters(in: .whitespaces)
		let floatRegex = try! NSRegularExpression(pattern: "\\d+\\.\\d+", options: [])
		let nsString = trimmedString as NSString
		
		let matches = floatRegex.matches(in: trimmedString, options: [], range: NSRange(location: 0, length: nsString.length))
		
		return matches.compactMap { match in
			guard let range = Range(match.range, in: trimmedString) else { return nil }
			return CGFloat(Double(trimmedString[range])!)
		}
	}
	
